package com.webpos.entity;import java.io.Serializable;public class DSystem  implements Serializable{  private static final long serialVersionUID = 1L;  private Long id;  private String content;  private String account;  private Integer withdraw_number;    public Integer getWithdraw_number()  {    return this.withdraw_number;  }    public void setWithdraw_number(Integer withdraw_number)  {    this.withdraw_number = withdraw_number;  }    public Long getId()  {    return this.id;  }    public void setId(Long id)  {    this.id = id;  }    public String getContent()  {    return this.content;  }    public void setContent(String content)  {    this.content = content;  }    public String getAccount()  {    return this.account;  }    public void setAccount(String account)  {    this.account = account;  }}